import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import { useRoutes } from 'react-router-dom';
import Router from './routes/Router';

function App() {
  const routing = useRoutes(Router);

  return (
    <React.Fragment>
      {routing}
    </React.Fragment>
  );
}

export default App;
